INSERT INTO `field_revision_body` VALUES ('node','patient_profile',0,5,5,'und',0,'<p>The patient is a 68-year-old Caucasion male who ws admitted to the VA on February 27, 2002, because of severe tremors and inabiity to walk from a chronic problem of Parkinson Disease. This gentleman had been having Parkinson disease for many yers and apparently, inspite of the medications that he was supposed to be getting outside, he was not improved or he was getting worse. We found, however, that lately, he has not been able to properly take the full dose of his carbidopa/levodopa medication because he also has dificulty of swallowing. This difficulty of swallowing has been noted last year, but somehow, he had been able to get by until lately. The more that he had difficulty swallowing the more that his Parkinson disease hasn&#39;t been controlled.</p>\r\n','','full_html'),('node','patient_profile',0,6,6,'und',0,'<p>This 42-year-old man complained of poor balance and frequent falls for 6 years. Imbalance has been progressive and he now cannot ambulate independantly. He is in good general health except for heavy alcohol use. For the last 10 years he has been consuming a quart of vodka and 5 beers daily. On awakening he feels &quot;shakey&quot; and calms himself with a morning drink. He has not had blackouts or delirium tremens but has had two seizures in the past. He smokes 1-2 packs/day but does not use drugs. Diagnostic imaging studies were done. (Report on 1st admission, 8-9-00). 2nd admission (6-10-01). He was found unconscious in his home in a pool of bloody vomitus by his relatives. He had apparently been on the floor for several days. He was confused and disoriented. He had a left-sided hemiparesis, left lower facial weakness and a left Babinski sign. Admitting labs showed Hb 4-7 (normal 13-15), hematocrit 13 (normal 40-50). Liver enzymes and creatine phosphokinase were elevated. CT scan and MRI showed an acute ischemic infarct.</p>\r\n','','full_html'),('node','patient_profile',0,7,7,'und',0,'<p>History of present illness: Eight years ago this 66 year old right handed man began to notice progressive decrease in dexterity of his right hand. He first noticed difficulty with drawing in his job as an architectural draftsman. His handwriting became smaller, less legible, and harder to decipher. He also was having increasing difficulty using his dominant hand for activities of daily living such as shaving, buttoning clothes, tying shoe laces, eating etc. His voice has become softer and speech harder to understand. His wife reports that he is stooped, walks slowly and shuffles and drags his right leg.</p>\r\n','','full_html'),('node','patient_profile',0,8,8,'und',0,'<p>Ed is a 57-year-old Caucasian male with a 15 year history of neurological disability which was diagnosed after his initial attack as multiple sclerosis. Lumbar puncture demonstrated the presence of numerous oligoclonal bands and MRI later showed multiple white matter plaques. He suffers from a significant dysarthria, as well as tremor and ataxia.</p>\r\n','','full_html');
/*!40000 ALTER TABLE `field_revision_body` ENABLE KEYS */;
UNLOCK TABLES;

