INSERT INTO `search_dataset` VALUES (4,'node',' alex age 54 sex male alex ',0),(5,'node',' bill age 68 sex male patient history the patient is a 68yearold caucasion male who ws admitted to the va on february 27 2002 because of severe tremors and inabiity to walk from a chronic problem of parkinson disease this gentleman had been having parkinson disease for many yers and apparently inspite of the medications that he was supposed to be getting outside he was not improved or he was getting worse we found however that lately he has not been able to properly take the full dose of his carbidopa levodopa medication because he also has dificulty of swallowing this difficulty of swallowing has been noted last year but somehow he had been able to get by until lately the more that he had difficulty swallowing the more that his parkinson disease hasn t been controlled bill ',0),(6,'node',' david age 44 sex male patient history this 42yearold man complained of poor balance and frequent falls for 6 years imbalance has been progressive and he now cannot ambulate independantly he is in good general health except for heavy alcohol use for the last 10 years he has been consuming a quart of vodka and 5 beers daily on awakening he feels shakey and calms himself with a morning drink he has not had blackouts or delirium tremens but has had two seizures in the past he smokes 12 packs day but does not use drugs diagnostic imaging studies were done report on 1st admission 8900 2nd admission 61001 he was found unconscious in his home in a pool of bloody vomitus by his relatives he had apparently been on the floor for several days he was confused and disoriented he had a leftsided hemiparesis left lower facial weakness and a left babinski sign admitting labs showed hb 47 normal 1315 hematocrit 13 normal 4050 liver enzymes and creatine phosphokinase were elevated ct scan and mri showed an acute ischemic infarct david ',0),(7,'node',' don age 66 sex male patient history history of present illness eight years ago this 66 year old right handed man began to notice progressive decrease in dexterity of his right hand he first noticed difficulty with drawing in his job as an architectural draftsman his handwriting became smaller less legible and harder to decipher he also was having increasing difficulty using his dominant hand for activities of daily living such as shaving buttoning clothes tying shoe laces eating etc his voice has become softer and speech harder to understand his wife reports that he is stooped walks slowly and shuffles and drags his right leg don ',0),(8,'node',' edward age 57 sex male patient history ed is a 57yearold caucasian male with a 15 year history of neurological disability which was diagnosed after his initial attack as multiple sclerosis lumbar puncture demonstrated the presence of numerous oligoclonal bands and mri later showed multiple white matter plaques he suffers from a significant dysarthria as well as tremor and ataxia edward ',0),(9,'node',' cranal nerve alex video video of the cranal nerve exam conducted for alex exam  cranial nerve patient reference  alex ',0),(10,'node',' relexes alex video relexes exam performed for alex exam  reflexes patient reference  alex ',0),(11,'node',' general observations alex video  exam  general observations patient reference  alex ',0),(12,'node',' motor alex video exam  motor patient reference  alex ',0),(13,'node',' motor david video exam  motor patient reference  david ',0),(14,'node',' general observations david video  exam  general observations patient reference  david ',0),(15,'node',' skull and spine david video  exam  skull and spine patient reference  david ',0);
